import React from "react";
import "./component/style/body.scss";
import Profile from "./component/profile";
// import Sidebar from "./component/sidebar";
import Navbar from "./component/navbar";
import Chart from "./component/chart";
import Welcome from "./component/welcome";
import foto from "./component/img/Asset 8.svg";
import icon1 from "./component/img/Dashboard.svg";
import { Row, Container, Col } from "react-bootstrap";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { render } from "@testing-library/react";

const routes = [{
        path: "/",
        exact: true,
        sidebar: () => < img className = "icon"
        src = { icon1 }
        alt = "icon" > < /img>,
        main: () => < dashboard / > ,
    },
    //   ,
    //   {
    //     path: "/bubblegum",
    //     sidebar: () => <div>bubblegum!</div>,
    //     main: () => <h2>Bubblegum</h2>
    //   },
    //   {
    //     path: "/shoelaces",
    //     sidebar: () => <div>shoelaces!</div>,
    //     main: () => <h2>Shoelaces</h2>
    //   }
];

export default function App() {
    return ( <
        Router >
        <
        Container fluid >
        <
        Profile / >
        <
        Row >
        <
        Col className = "col-md-2 bg-white position-sticky" >
        <
        div className = "sidebar text-nowrap " >
        <
        div className = "brand-icon" >
        <
        img src = { foto }
        alt = "prop" / >
        <
        /div> <
        ul className = "select text-break" >
        <
        li >
        <
        Switch > {
            routes.map((route, index) => ( <
                Route key = { index }
                path = { route.path }
                exact = { route.exact }
                children = { < route.sidebar / > }
                />
            ))
        } <
        /Switch> <
        Link to = "/" >
        <
        a href = "#"
        className = "aktif" >
        Dashboard <
        /a> <
        path class = "block" > < /path> <
        /Link> <
        /li> <
        li >
        <
        a href = "#" > { /* <img className="icon" src={icon1} alt="icon"></img> */ }
        Logistik <
        /a> <
        /li> <
        li >
        <
        a href = "#" > { /* <img className="icon" src={icon1} alt="icon"></img> */ }
        Bencana Alam <
        /a> <
        /li>

        <
        li >
        <
        a href = "#" > { /* <img className="icon text" src={icon1} alt="icon"></img> */ }
        Penanggulangan Bencana <
        /a> <
        /li> <
        li >
        <
        a href = "#" > { /* <img className="icon" src={icon1} alt="icon"></img> */ }
        Pegawai BPBD <
        /a> <
        /li> <
        li >
        <
        a href = "#" > { " " } { /* <img className="icon" src={icon1} alt="icon"></img> */ }
        Relawan <
        /a> <
        /li> <
        li >
        <
        a href = "#" > { /* <img className="icon" src={icon1} alt="icon"></img> */ }
        Laporan <
        /a> <
        /li> <
        /ul> <
        /div> <
        /Col>{" "} <
        Col className = "col-md-10" >
        <
        Switch > {
            routes.map((route, index) => ( <
                Route key = { index }
                path = { route.path }
                exact = { route.exact }
                children = { < route.main / > }
                />
            ))
        } <
        /Switch> <
        /Col>{" "} <
        /Row>{" "} <
        /Container>{" "} <
        /Router>
    );
}

function dashboard() {
    return ( <
        Navbar / >
    );
}
